import { React } from "react";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";

const LoginForm = () => {
  return (
    <form>
      <TextField label="Login" />
      <TextField label="Password" />
    </form>
  );
};

export default LoginForm;
